import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app_wrapper">
      <header className='header'>
        <img src='https://ru.msi.com/images/MSI_logo_for_share2.png' />
      </header>

      <nav className='nav'>
        <a href = "#r">Profile</a>
        <div></div>
        <a href = "#r">Messages</a>
        <div></div>
        <a href = "#r">News</a>
        <a href = "#r">Music</a>
        <a href = "#r">Settings</a>
      </nav>

      <div className='content'>
        Main content
      </div>
    </div>
  );
}

export default App;
